import { solve } from './solver';
var queue = [];
var Queue = {
  register: function register(n, maxIterations, model, ownership, players, sport, site, type) {
    queue.push(solve(n, maxIterations, model, ownership, players, sport, site, type));
  },
  go: function go() {
    var results = [];

    while (queue.length) {
      var top = queue.shift();
      var response = top.go();

      if (response.notFeasible || top.isDone()) {
        top.results.forEach(function (result) {
          return results.push(result);
        });
        continue;
      }

      queue.push(top);
    }

    return results;
  }
};
export default Queue;
